/**
 * Compare two lists of objects for reference-equality.
 */
private static boolean referenceEquals(Object[] a1, Object[] a2) {
  if (a1.length != a2.length) { 
    return false;
  }

  for (int i = 0; i < a1.length; i++) {
    if (a1[i] != a2[i]) { 
      return false;
    }
  }

  return true;
}

